import React from "react";
import PropTypes from "prop-types";
import email from '../img/email.svg'
import github from '../img/github.png';
import contact from '../img/contact.svg';
import linkedin from '../img/linkedin.png';

const data = [
	{
		label: 'Email:\nag.aditigupta12@gmail.com',
		icon: email
	},
	{
		label: 'LinkedIN :\nhttps://www.linkedin.com/in/aditi-gupta-006aab160/',
		icon: linkedin
	},
	{
		label: 'Github:\nhttps://github.com/aaditi2034',
		icon: github
	},
	{
		label: 'Contact :\n+918979798336',
		icon: contact
	},
]
export default class Contact extends React.Component {
	render() {
		return (
			<div id="my-contact" className="container text-center my-5">
				<h1 id="contact" className={"mb-3 " + this.props.fadeInLeft}>
					Contact
				</h1>
				<div className="row mt-5">
					{
						data.map((list, index) => (
							<div
								key={index}
								className={"col-6 col-sm-6 col-md-3 "}>
								<div><img src={list.icon} alt="" /></div>
								<span>{list.label}</span>
							</div>
						))
					}
				</div>
			</div>
		);
	}
}

Contact.propTypes = {
	fadeInLeft: PropTypes.string,
	shake: PropTypes.string
};
